import React, { useState } from "react";
import axios from "axios";

const InsuranceBot = () => {
  const [messages, setMessages] = useState([]);
  const [newMessage, setNewMessage] = useState("");
  const [listening, setListening] = useState(false);

  const backendUrl = "http://localhost:8000/chat";

  const sendMessage = async () => {
    if (!newMessage.trim()) return;

    const userMessage = { type: "user", text: newMessage };
    setMessages((prev) => [...prev, userMessage]);

    try {
      const response = await axios.post(backendUrl, { message: newMessage });
      const botReply = response.data.response;

      setMessages((prev) => [...prev, { type: "bot", text: botReply }]);
      speakText(botReply);  // Bot speaks response
    } catch (error) {
      console.error("Error sending message:", error);
    }

    setNewMessage("");
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") {
      sendMessage();
    }
  };

  // Voice input function
  const startListening = () => {
    if (!("webkitSpeechRecognition" in window)) {
      alert("Voice recognition not supported in your browser.");
      return;
    }

    const recognition = new window.webkitSpeechRecognition();
    recognition.lang = "en-US";
    recognition.start();
    setListening(true);

    recognition.onresult = (event) => {
      const speechText = event.results[0][0].transcript;
      setNewMessage(speechText);
      setListening(false);
    };

    recognition.onerror = (event) => {
      console.error("Speech recognition error:", event.error);
      setListening(false);
    };

    recognition.onend = () => {
      setListening(false);
    };
  };

  // Voice output function
  const speakText = (text) => {
    const utterance = new SpeechSynthesisUtterance(text);
    utterance.lang = "en-US";
    speechSynthesis.speak(utterance);
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Health Insurance Assistant ðŸ’¬</h1>
      <div style={styles.chatBox}>
        {messages.map((msg, idx) => (
          <div
            key={idx}
            style={{
              ...styles.message,
              alignSelf: msg.type === "user" ? "flex-end" : "flex-start",
              backgroundColor: msg.type === "user" ? "#dcf8c6" : "#f1f0f0",
            }}
          >
            {msg.text}
          </div>
        ))}
      </div>
      <div style={styles.inputArea}>
        <input
          type="text"
          placeholder="Type your message..."
          value={newMessage}
          onChange={(e) => setNewMessage(e.target.value)}
          onKeyDown={handleKeyPress}
          style={styles.input}
        />
        <button onClick={sendMessage} style={styles.button}>
          Send
        </button>
        <button
          onClick={startListening}
          style={{
            ...styles.micButton,
            backgroundColor: listening ? "#e53935" : "#3f51b5",
          }}
        >
          ðŸŽ™
        </button>
      </div>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "700px",
    margin: "auto",
    marginTop: "30px",
    padding: "20px",
    borderRadius: "12px",
    boxShadow: "0 0 20px rgba(0,0,0,0.2)",
    fontFamily: "Arial, sans-serif",
    backgroundColor: "#ffffff",
  },
  heading: {
    textAlign: "center",
    color: "#333",
    marginBottom: "20px",
  },
  chatBox: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    minHeight: "400px",
    maxHeight: "400px",
    overflowY: "auto",
    padding: "10px",
    border: "1px solid #ddd",
    borderRadius: "8px",
    marginBottom: "10px",
  },
  message: {
    padding: "10px 14px",
    borderRadius: "12px",
    maxWidth: "80%",
    wordBreak: "break-word",
  },
  inputArea: {
    display: "flex",
    alignItems: "center",
    gap: "10px",
  },
  input: {
    flex: 1,
    padding: "10px",
    borderRadius: "8px",
    border: "1px solid #ccc",
    outline: "none",
  },
  button: {
    padding: "10px 16px",
    borderRadius: "8px",
    backgroundColor: "#4CAF50",
    color: "#fff",
    border: "none",
    cursor: "pointer",
  },
  micButton: {
    padding: "10px",
    borderRadius: "50%",
    color: "#fff",
    border: "none",
    cursor: "pointer",
  },
};

export default InsuranceBot;
